import React from 'react';
/** Import components */
import {
  Navbar,
  NavbarBrand,
  Button,
  Row,Col
} from 'reactstrap';
import { NavLink } from 'react-router-dom';

/** Import assets */
import logo from 'assets/images/logo.png';
import logoTesxtImage from 'assets/images/logo_text.png';
import homeIcon from 'assets/images/sidebar/home.png';
import exerciseIcon from 'assets/images/sidebar/exercise.png';
import hoodIcon from 'assets/images/sidebar/food.png';
import supplementsIcon from 'assets/images/sidebar/supplements.png';
import './topNav.css';

class TopNav extends React.Component {
  handleLogoutClick(e) {
    this.props.authActions.logout();
  }
  render() {
    // const { name } = this.props.currentUser;
    return (
      <div className="top-nav" >
      <Row>
        <Col xs = {4}></Col>
        <Col xs = {4}>
          <img style = {{width:"100%"}} src = {logoTesxtImage}/>
        </Col>
        <Col xs = {4}></Col>
      </Row>
      <div >
        <Navbar light expand className="shadow-sm bg-white p-0 h-100">
          <NavbarBrand>
                 <img src={logo} alt="ChatMatic" className="top-nav-logo" />
          </NavbarBrand>
          <NavbarBrand>
            <NavLink
              activeClassName="active"
              to={`/home`}
            >
             <img src = {homeIcon} style = {{width:"24px;",verticalAlign:"text-bottom", marginRight:"5px"}}/>Home
            </NavLink>
          </NavbarBrand>
          <NavbarBrand >
            <NavLink
              activeClassName="active"
              to={`/exercise`}
            >
            <i className = "fa fa-home"></i> Exercise
             </NavLink>
          </NavbarBrand>
          <NavbarBrand>
            <NavLink
              activeClassName="active"
              to={`/food`}
            >
            <i className = "fa fa-home"></i> Food
             </NavLink>
          </NavbarBrand>
          <NavbarBrand >
            <NavLink
              activeClassName="active"
              to={`/supplements`}
            >
              <i className = "fa fa-home"></i> Supplements
             </NavLink>
          </NavbarBrand>
        </Navbar>
      </div>
      </div>
    );
  }
}

export default TopNav
